import React from "react";
import CategoryItem from "./CategoryItem";

const CategoryList = () => {
  return (
    <>
      <div className="d-flex ">
        <CategoryItem />
        <CategoryItem />
        <CategoryItem />
      </div>
    </>
  );
};

export default CategoryList;
